import styles from './Project.module.css'
import ProjCard from './ProjCard'
import TopicName from './TopicName';
import img1 from '../assets/dev1.png'
import img2 from '../assets/dev2.jpg'
import img3 from '../assets/dev3.png'
import img4 from '../assets/dev4.png'

function Project(){
    return (

        <div className={styles.wrapper}>
            <TopicName title="Projects"></TopicName>
            <ProjCard title={"Blogs Website"} image={img1} info={"A simple Blogs website made using the Hugo Framework. Hugo is an amazing tool for making static websites with minimal effort and I took advantage of that fact and made a simple Blogs website for myself :)"}></ProjCard>
            <ProjCard title={"Blogs Website"} image={img2} info={"A simple Blogs website made using the Hugo Framework. Hugo is an amazing tool for making static websites with minimal effort and I took advantage of that fact and made a simple Blogs website for myself :)"}></ProjCard>

        </div>
    )
}
export default Project;
